sys_variable_value.value:
(function execute(inputs, outputs) {
  	var xmlDoc = new XMLDocument2();
	xmlDoc.parseXML(inputs.response);
  	outputs.delivery_status = xmlDoc.getFirstNode('//TrackResponse/TrackInfo/TrackSummary/Event').getTextContent();
  	outputs.event_date = xmlDoc.getFirstNode('//TrackResponse/TrackInfo/TrackSummary/EventDate').getTextContent();
    outputs.event_time = xmlDoc.getFirstNode('//TrackResponse/TrackInfo/TrackSummary/EventTime').getTextContent();
  	outputs.projected_delivery_date = xmlDoc.getFirstNode('//TrackResponse/TrackInfo/ExpectedDeliveryDate') ? xmlDoc.getFirstNode('//TrackResponse/TrackInfo/ExpectedDeliveryDate').getTextContent() : 'n/a';
	outputs.projected_delivery_time = xmlDoc.getFirstNode('//TrackResponse/TrackInfo/ExpectedDeliveryTime') ? xmlDoc.getFirstNode('//TrackResponse/TrackInfo/ExpectedDeliveryDate').getTextContent() : 'n/a';
})(inputs, outputs);

